import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import './LeftVerticalMenu.scss';

export default class LeftVerticalMenu extends Component {
  render () {
    return (
      <nav>
        <ul>
          <li>
            <Link to="/" className="left-vertical-menu" style={{ animationDelay: '4s' }}>
              Portfolio
            </Link>
          </li>
          <li>
            <Link to="/" className="left-vertical-menu" style={{ animationDelay: '4.2s' }}>
              Github
            </Link>
          </li>
        </ul>
      </nav>
    );
  }
}
